package mypackage;

public class Test03 {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		int x=1;
		System.out.println(x);//1
		System.out.println(++x);//2
		System.out.println(x);//2
		
		int y=1;
		System.out.println(y);//1
		System.out.println(y++);//1
		System.out.println(y);//2
	}

}
